0.5 0.75 position moveto
4 string stringwidth pop 90 2 mul add neg 0 rmoveto % goofy centering logic
gsave
1 1 31 {
  dup dup
  code2 exch get
  12 codexshow ( ) show
  gsave
    /Times findfont 12 scalefont setfont
    code2 exch get pronunciation exch get show
